import React from 'react';
import PropTypes from 'prop-types';     // prop-types 모듈 사용
import Link from 'next/link';
import { Menu, Row, Col } from 'antd';            // https://ant.design/components/menu/
import styled from 'styled-components';
import { useSelector } from 'react-redux';
import { Button } from 'antd';

import LOGO from '../images/WEB_LOGO.png'
import APP_STORE from '../images/APP_STORE.png'
import PLAY_STORE from '../images/PLAY_STORE.png'

const Background = styled.div`
    width: 100%;
    height: 100vh;
    background-color: #FFFFFF
`

const MyMenu = styled.ul`
    list-style-type: none;
`
const ABOUT = () => {
    return (
        <Background>
        <Row>
            <Col xs={24} md={12} >
            </Col>

            <Col xs={24} md={12} >
                <div>
                    <MyMenu>
                        <li><a style={{color: '#FA5A5A', display: 'inline'}}>HOME</a></li>
                        <li><a style={{color: '#FA5A5A', display: 'inline-block'}}>ABOUT</a></li>
                        <li><a style={{color: '#FA5A5A', display: 'inline'}}>CHARACTOR</a></li>
                        <li><a style={{color: '#FA5A5A', display: 'inline'}}>HELP</a></li>
                    </MyMenu>
                </div>
            </Col>
        </Row>

    </Background>
    );
};


export default ABOUT;
